import {React, useState} from 'react';
import BlogPost from '../Components/BlogPost.js'

function Main() {
    const [Posts, setPosts] = useState(null);
    fetch('http://localhost:3001/allblogs').then(
        res => {
            return res.json()
        }
    ).then(
        response => {
            const Posts = response.res
            setPosts(Posts)
        }
    )
    console.log(Posts)
    return (
        <div>
            <BlogPost />
        </div>
    )
}

export default Main;
